import React from 'react';
import styled from 'styled-components';
import EcosystemHeader from './EcosystemHeader';
import EcosystemBody from './ecosystem_body';
import FooterAE from './FooterAE';

const EcosystemPage = styled.div`
  margin: 2mm;
  padding: 1mm;
  background-color: #000;
  color: #fff;
  display: flex;
  flex-direction: column;
  min-height: 100vh;
`;

function Ecosystem() {
  return (
    <EcosystemPage>
      <EcosystemHeader />
      <EcosystemBody />
      <FooterAE />
    </EcosystemPage>
  );
}

export default Ecosystem;
